import React from "react";
import { Paper } from "@material-ui/core";

const About = () => {
  const styles = {
    margin: "auto",
    width: "50%",
    marginTop: "50px",
    elevation: 5,
  };
  return (
    <div className="about-container">
      <Paper style={styles}>
        <h1>LEVEL UP is a Productivity app!</h1>
        <p>
          The idea for this app came from my personal level up chart on a white
          board. I was learning Python, SQL, JavaScript, Django, React, HTML,
          CSS, and AWS at the same time, and at some point I realized I had to
          come up with a way to visually remind myself of where I was putting my
          time.
        </p>

        <p>
          So I created a chart on my white board and wrote down names of the
          skills I was trying to level up. Every time I would spend an hours
          worth of studying/practice, I would give myself a point. Eventually
          when I had too many points in a particular skill I leveled it up and
          started the bar from empty.
        </p>
        <p>
          This method is simple and really helped me to see where I was putting
          my time and where I wasn't! I wanted to share my method with other
          people that were learning new skills, so I decided to make this level
          up app.
        </p>
      </Paper>
    </div>
  );
};

export default About;
